import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="App-content">
        <h1>Welcome to My React App</h1>
        <p>This is a creative React application for Lab 7!</p>
        <button className="App-button">Get Started</button>
      </div>
    </div>
  );
}

export default App;
